import React from 'react';
import Counter from "./counter";

import "./someContainer.css";

class SomeContainer extends React.Component
{
    render()
    {
        return(
            <div className="arbitrary-inner-block">
            <Counter />
            </div>
        )
    }
}

export default SomeContainer;
